import React from 'react'
import { Link } from 'react-router-dom'

const DUMMY_EVENTS =[
    {name: 'event one', id: 1},
    {name: 'event two', id: 2},
    {name: 'event three', id: 3},
    {name: 'event four', id: 4}
]

const EventsPage = () => {
  return (
    <div><h1>Events page</h1>
        {DUMMY_EVENTS.map(evt=><p>{evt.name} <Link to={`events/${evt.id}`}>Click for more details</Link></p>)}
    </div>
  )
}

export default EventsPage
